"use strict";(self.webpackChunkxing_life_3=self.webpackChunkxing_life_3||[]).push([[3518],{4369:a=>{a.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"vancouver-canada-place-20240405","metadata":{"permalink":"/vancouver-canada-place-20240405","source":"@site/blog/2024-04-05-canada-place.mdx","title":"2024-04-05 go around in vancouver downtown","description":"I went around in downtown today. The first point was Gastown Steam Clock. I didn\'t see the steam because it was maintaining. I will come back here for the steam.","date":"2024-04-05T00:00:00.000Z","tags":[{"inline":false,"label":"Canada","permalink":"/tags/Canada","description":"Canada"},{"inline":false,"label":"Vancouver","permalink":"/tags/VancouverBC","description":"Vancouver of British Columbia in Canada"}],"readingTime":0.425,"hasTruncateMarker":true,"authors":[{"name":"Xing312101","title":"Xing312101\'s supervisor","url":"https://xing312101.github.io","imageURL":"/img/xing_icon.png","key":"xing312101","page":null}],"frontMatter":{"slug":"vancouver-canada-place-20240405","title":"2024-04-05 go around in vancouver downtown","authors":["xing312101"],"tags":["Canada","Vancouver"]},"unlisted":false,"nextItem":{"title":"2024-04 Cherry Blossom in Vancouver","permalink":"/vancouver-cherry-blossom-2024"}},"content":"\x3c!-- truncate --\x3e\\n\\n\\nI went around in downtown today. The first point was Gastown Steam Clock. I didn\'t see the steam because it was maintaining. I will come back here for the steam.\\n![alt text](/img/2024/20240405_clock2_L.jpeg \\"20240405_clock2\\")\\n![alt text](/img/2024/20240405_clock_L.jpeg \\"20240405_clock\\")\\n\\nI also went to Canada Place. I saw the seaplanes first time. I thought I will come here often, and it is actually happening.\\n\\n![alt text](/img/2024/20240405_canada_place_L.jpeg \\"20240405_canada_place\\")\\n![alt text](/img/2024/20240405_canada_place2_L.jpeg \\"20240405_canada_place2\\")\\n![alt text](/img/2024/20240405_canada_place3_L.jpeg \\"20240405_canada_place3\\")\\n\\n[Instagram video: Landing of a seaplane](https://www.instagram.com/reel/C5bNsn5pkND \\"Landing of a seaplane\\")\\n\\nTODO: instagram embed"},{"id":"vancouver-cherry-blossom-2024","metadata":{"permalink":"/vancouver-cherry-blossom-2024","source":"@site/blog/2024-04-01-vancouver-cherry-blossom-session.mdx","title":"2024-04 Cherry Blossom in Vancouver","description":"In 2024, I was living in Burnaby. I had to commute to downtown Vancouver for school during the cherry blossom season. And I took some pictures on the way.","date":"2024-04-01T00:00:00.000Z","tags":[{"inline":false,"label":"Canada","permalink":"/tags/Canada","description":"Canada"},{"inline":false,"label":"Vancouver","permalink":"/tags/VancouverBC","description":"Vancouver of British Columbia in Canada"}],"readingTime":0.45,"hasTruncateMarker":true,"authors":[{"name":"Xing312101","title":"Xing312101\'s supervisor","url":"https://xing312101.github.io","imageURL":"/img/xing_icon.png","key":"xing312101","page":null}],"frontMatter":{"slug":"vancouver-cherry-blossom-2024","title":"2024-04 Cherry Blossom in Vancouver","authors":["xing312101"],"tags":["Canada","Vancouver"]},"unlisted":false,"prevItem":{"title":"2024-04-05 go around in vancouver downtown","permalink":"/vancouver-canada-place-20240405"},"nextItem":{"title":"2024-03 Go to Canada","permalink":"/goto-canada-2024"}},"content":"\x3c!-- truncate --\x3e\\n\\nIn 2024, I was living in Burnaby. I had to commute to downtown Vancouver for school during the cherry blossom season. And I took some pictures on the way.\\n\\nFirst day at school and lunch time. I bought a burrito near the Burrard Station. There was a cherry blossom tree.\\n![alt text](/img/2024/20240401_cherry_blossom_1_L.jpeg \\"20240401_cherry_blossom_1\\")\\n\\nOne day, after the rain.\\n![alt text](/img/2024/20240401_cherry_blossom_2_L.jpeg \\"20240401_cherry_blossom_2\\")\\n\\n\\n![alt text](/img/2024/20240401_cherry_blossom_3_L.jpeg \\"20240401_cherry_blossom_3\\")\\n\\n\\nThe cherry blossoms have almost fallen and begun to sprout. This picutre is my favorite from this cherry blossom season.\\n![alt text](/img/2024/20240401_cherry_blossom_4_L.jpeg \\"20240401_cherry_blossom_4\\")"},{"id":"goto-canada-2024","metadata":{"permalink":"/goto-canada-2024","source":"@site/blog/2024-03-23-go-to-canada.mdx","title":"2024-03 Go to Canada","description":"On March 23, 2024, I took the flight to go to Canada. I gave myself birthday presents: Canada ticket and working holiday.","date":"2024-03-23T00:00:00.000Z","tags":[{"inline":false,"label":"Canada","permalink":"/tags/Canada","description":"Canada"},{"inline":false,"label":"Taiwan","permalink":"/tags/Taiwan","description":"Taiwan"},{"inline":false,"label":"Vancouver","permalink":"/tags/VancouverBC","description":"Vancouver of British Columbia in Canada"},{"inline":false,"label":"Taoyuan","permalink":"/tags/Taoyuan","description":"Taoyuan"}],"readingTime":1.01,"hasTruncateMarker":true,"authors":[{"name":"Xing312101","title":"Xing312101\'s supervisor","url":"https://xing312101.github.io","imageURL":"/img/xing_icon.png","key":"xing312101","page":null}],"frontMatter":{"slug":"goto-canada-2024","title":"2024-03 Go to Canada","authors":["xing312101"],"tags":["Canada","Taiwan","Vancouver","Taoyuan"]},"unlisted":false,"prevItem":{"title":"2024-04 Cherry Blossom in Vancouver","permalink":"/vancouver-cherry-blossom-2024"}},"content":"\x3c!-- truncate --\x3e\\n\\nOn March 23, 2024, I took the flight to go to Canada. I gave myself birthday presents: Canada ticket and working holiday.\\n\\nIn my plan, I hadda be in the air by the day, but the flight was delayed. It was not a big problem because the most important thing is I entered the day twice. Time travel!\\n\\nSo that my age is quite interesting now.\\n\\nBefore coming Canada, I decided to chooce Oliver as my English name, becuase English teachers said that some people have difficulty pronouncing Chinese names clearly.\\n\\nI had used Kimi as my identity for 4 years. I\u2019m not sure how long I\u2019ll use Oliver as my identity.\\n\\n![alt text](/img/2024/20240323_flight_ticket_L.jpeg \\"20240323_flight_ticket\\")\\n\\nA woman sitting next to me mentioned that it\u2019s unusual for so many airplanes to be waiting at the moment. She is living in Canada but goes to Taiwan every two years.\\n\\n![alt text](/img/2024/20240323_flights_L.jpeg \\"20240323_flights\\")\\n\\nI felt uncomfortable because I couldn\'t sleep well and have to sit there for long hours.\\n\\nI sat by window side but the view was not interesting. Too brightness and blue sky only. The window had some ice crystals. I tried to take a good picture.\\n\\n![alt text](/img/2024/20240323_ice_crystals_L.jpeg \\"20240323_ice_crystals\\")"}]}}')}}]);